import './App.css';
import  Product  from './Components/Product/Product';
import { BrowserRouter, Routes, Route } from "react-router-dom";


export default function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route path="products" element={<Product />} />
      </Routes>
    </BrowserRouter>
  );
}
